import React, { useCallback, useState } from 'react';
import { FiPower, FiArrowLeft, FiArrowRight } from 'react-icons/fi';
import {
  ProSidebar,
  Menu,
  MenuItem,
  SubMenu,
  SidebarFooter,
  SidebarHeader,
  SidebarContent,
} from 'react-pro-sidebar';

import Link from 'next/link';

import { useAuthentication } from '@/hooks/authentication';
import { Flex, Box, Tooltip, Text } from '@chakra-ui/core';

import { Container } from './styles';

interface ISidebarProps {
  top?: React.ReactNode;
  middle?: React.ReactNode;
}

const Sidebar: React.FC<ISidebarProps> = () => {
  const { logOut } = useAuthentication();

  return (
    <>
      <Container>
        <ProSidebar>
          <SidebarHeader
            css={{
              height: 60,
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
            }}
          >
            <Text fontWeight="bold" fontSize={24}>
              Menu
            </Text>
          </SidebarHeader>

          <SidebarContent>
            <Menu iconShape="square">
              <MenuItem>Relatório A</MenuItem>
              <MenuItem>Relatório B</MenuItem>
            </Menu>
          </SidebarContent>

          <SidebarFooter
            css={{
              display: 'flex',
              justifyContent: 'center',
            }}
          >
            <Tooltip label="Sair" aria-label="Sair">
              <Box cursor="pointer" onClick={logOut} padding={3}>
                <FiPower size={20} color="gray.200" />
              </Box>
            </Tooltip>
          </SidebarFooter>
        </ProSidebar>
      </Container>
    </>
  );
};
export default Sidebar;
